import React from 'react';
import './Botnav.css';
import BotnavItem from './BotnavItem/BotnavItem';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import {
    faFacebookF,
    faGithub,
    faFacebookMessenger,
    faLinkedin
} from '@fortawesome/free-brands-svg-icons';

const Botnav = () => {
    return (
        <header className='botnav'>
            <nav className='botnav__nav'>
                <div className='botnav__nav-spacer'></div>
                <div className='botnav__nav-links'>


                    <BotnavItem 
                    icon={'facebook'}
                    url={"https://www.facebook.com/filipzakrocki77"}
                    />
                    <BotnavItem 
                    icon={'github'}
                    url={"https://github.com/filipzakrocki"}
                    />
                    <BotnavItem 
                    icon={'linkedin'}
                    url={"https://www.linkedin.com/in/filip-zakrocki-08b561190/"}
                    />
                    <BotnavItem 
                    icon={'mail'}
                    url={"mailto:zakrofil@gmail.com"}
                    />
                    <BotnavItem 
                    icon={'messenger'}
                    url={"http://m.me/filipzakrocki77"}
                    />
                    
                    
                    
                </div>
                <div className='botnav__nav-spacer'></div>
            </nav>
        </header>
        
    );
}

export default Botnav;
